well, in general: the biggest problem is the situation like below: 

```
-    Cluster cluster = heartbeatTestHelper.getDummyCluster();
+    heartbeatTestHelper.getDummyCluster();
```

i think here it is better to remove not used line completely, instead of removing only unused variable

@smolnar82 

Rather than this large change, why not just add the following to the end of `org.apache.ambari.server.serveraction.kerberos.FinalizeKerberosServerAction#execute`:
```
    try {
      topologyHolder.updateData(topologyHolder.getCurrentData());
    }
    catch (Exception e) {
      LOG.error("Failed to send topology update event when enabling kerberos", e);
    }
```

While at it, the following should probably be removed from `org.apache.ambari.server.controller.AmbariManagementControllerImpl#createHostAction` since it is no longer doing any thing:
```
    // If we are starting a component, calculate whether the unlimited key JCE policy is
    // required for the relevant host.  One of the following indicates that the unlimited
    // key JCE policy is required:
    //
    //   * The component explicitly requires it whether Kerberos is enabled or not (example, SMARTSENSE/HST_SERVER)
    //   * The component explicitly requires it only when Kerberos is enabled AND Kerberos is enabled (example, most components)
    //
    // Set/update the unlimited_key_jce_required value as needed
    hostParams.put(UNLIMITED_KEY_JCE_REQUIRED, (getUnlimitedKeyJCERequirement(componentInfo, cluster.getSecurityType())) ? "true" : "false");

    execCmd.setHostLevelParams(hostParams);
```

But the comment should be added to `org.apache.ambari.server.controller.AmbariManagementControllerImpl#getTopologyComponentLevelParams`, in the appropriate place:
```
    // If we are starting a component, calculate whether the unlimited key JCE policy is
    // required for the relevant host.  One of the following indicates that the unlimited
